import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import AcceptDelivery from './components/AcceptDelivery';
import RequestDelivery from './components/RequestDelivery';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <Router>
    <Routes>
      <Route exact path="/" element={<App />}></Route>
      <Route exact path="/RequestDelivery" element={<RequestDelivery />}></Route>
      <Route exact path="/AcceptDelivery" element={<AcceptDelivery />}></Route>
    </Routes>
  </Router>
);
